import React from 'react'

export default function ProductCard({ title, price, imgUrl }) {
    return (
        <div>
            <p>Title: {title}</p>
            <p>Price: {price}</p>
            <imgUrl src={imgUrl} alt="" srcset="" />
        </div>

    )
}
